import React, { useState,useEffect } from 'react'
import axios from 'axios'

const Axios = () => {

    const [users,setUsers]=useState([])

    useEffect(() => {
        const loadUsers= async()=>{
            const res= await axios('https://jsonplaceholder.typicode.com/users')

            setUsers(res.data)
        }
        loadUsers()
    }, [])

    return (
        <>
          <ul>
              {/* {
