                      <li key= {item.id}> <br />
                          Nombre: {item.name} <br />
                          Apellido: {item.username} <br />
                          email: {item.email} <br />
                          phone: {item.phone} <br /><br />
                      </li>
                  })

              } */}
          </ul>
        </>
    )
}

export default Axios
